            "created": 1448903390000, 
            "description": "<p>Abstract:<br/>R has become the go-to environment to support data science and statistical applications across many fields. Researchers write papers in R, engineers develop runtime applications in R, and new statistical methods are first developed in R. Supporting this powerful environment is a complete programming language and a wealth of numerical analysis tools. R has a built-in matrix language that can solve mathematical problems above and beyond statistical regression. This talk will walk through R's tools for matrix manipulation, interpolation, integration, and root finding.</p> <p>Speaker:<br/>James P. Howard, II</p>", 
